import React, {Component} from "react";
import NavBar from './NavBar';

class Header extends Component{
    render(){
        return(
            <React.Fragment> 
                <header>
                <h2>Welcome to FashionApp!</h2>
                <NavBar/>
                </header>
            </React.Fragment>
        )
    }
}
export default Header;
